import React, { useState, useEffect } from "react";
import axios from "axios";
import Employee from "../components/Employee";

const Search = props => {
  console.log("PROPS", props.data);
  const data = props.data;
  return (
    <div>
      <h1>Searchbar</h1>
      {data.map(employee => {
        return (
          <div key={employee._id}>
            <h3>employee.name</h3>
          </div>
        );
      })}
    </div>
  );
};

export default Search;
